maze = ''
pos = 0

while True:
    print(maze[0:pos] + 'x' + maze[pos+1:])
    inp = input()
    if inp == 'r':
        if (maze[pos+50]=='0'):
            pos+=50
        else:
            print("Nope")
    elif inp == 'e':
        if (maze[pos+1]=='0'):
            pos+=1
        else:
            print("Nope")
    elif inp == 'q':
        if (maze[pos-50]=='0'):
            pos-=50
        else:
            print("Nope")
    elif inp == 'w':
        if (maze[pos-1]=='0'):
            pos-=1
        else:
            print("Nope")